import Nav from 'react-bootstrap/Nav'
import React from 'react';




function Navbar(){

    const nav_items = [
        { key: "home", title: "Hem" },
        { key: "events", title: "Pub & Event" },
        { key: "km", title: "Klubbm채steriet" },
        { key: "contact", title: "Klubbm채steriet" }
    ];

    const content = nav_items.map((item) => {
        return (
            <Nav.Item>
                <Nav.Link activeKey={item.key}> {item.title} </Nav.Link>
            </Nav.Item>
        )
    });

    return (
        <Nav className={"clearfix"}>
            <div className={"left"}>
                { content }
            </div>
            <div className={"right"}>
                <Nav.Item>
                    <Nav.Link activeKey={4}> Logga in </Nav.Link>
                </Nav.Item>
            </div>
        </Nav>
    )
}

export default Navbar
